        private static Dictionary<string, PropertyKey> proplist = new Dictionary<string, PropertyKey>();

        /// <summary>
        /// Find a property key by name
        /// </summary>
        /// <param name="propertyName"></param>
        /// <returns></returns>
        public static PropertyKey? FindByName(string propertyName)
        {
            PropertyKey pk;

            if (proplist.TryGetValue(propertyName, out pk)) return pk;
            return null;
        }

        /// <summary>
        /// Convert a collection of <see cref="PropertyKey"/> structures into a dictionary of name/value pairs.
        /// </summary>
        /// <param name="props"></param>
        /// <returns></returns>
        public static Dictionary<string, PropertyKey> PropListToDict(IEnumerable<PropertyKey> props)
        {
            var ret = new Dictionary<string, PropertyKey>();

            foreach (var prop in props)
            {
                foreach (var kv in proplist)
                {
                    if (kv.Value == prop)
                    {
                        ret.Add(kv.Key, kv.Value);
                        break;
                    }
                }
            }

            return ret;
        }

        static PropertyKeys()
        {
            var unsprop = typeof(PropertyKeys).GetFields(BindingFlags.Public | BindingFlags.Static);


            var fis = new List<FieldInfo>(unsprop);

            fis.Sort((a, b) =>
            {
                return string.Compare(a.Name, b.Name);
            });

            foreach (var fi in fis)
            {
                var obj = fi.GetValue(null);

                if (obj is PropertyKey pk)
                {
                    proplist.Add(fi.Name, pk);
                }
            }
        }

        public static string GetPropertyName(PropertyKey pk)
        {

            string s;

            foreach (var prop in proplist)
            {
                if (prop.Value == pk) return prop.Key;
            }

            return null;
        }

        /// <summary>
        /// Returns a dictionary of all properties known to this library.
        /// </summary>
        /// <returns></returns>
        public static IReadOnlyDictionary<string, PropertyKey> GetAvailableProperties()
        {
            return new ReadOnlyDictionary<string, PropertyKey>(proplist);
        }


